import MSFTTreeViewItem from "./tree-view-item";
import treeViewItemSchema from "./tree-view-item.schema";
import manageJss from "@microsoft/fast-jss-manager-react";
import { TreeViewItemStyles } from "@microsoft/fast-components-styles-msft";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const TreeViewItem = manageJss(TreeViewItemStyles)(MSFTTreeViewItem);
export { TreeViewItem, treeViewItemSchema, };
